package com.anoml.api.handler;

import com.anoml.api.handler.utils.FileLogger;
import org.apache.synapse.ManagedLifecycle;
import org.apache.synapse.MessageContext;
import org.apache.synapse.core.SynapseEnvironment;
import org.apache.synapse.rest.AbstractHandler;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

public class DiskIOAPIHandler extends AbstractHandler implements ManagedLifecycle {
    private static final Logger logger = LoggerFactory.getLogger(DiskIOAPIHandler.class);

    public boolean handleRequest(MessageContext messageContext) {
        logger.error("Inside DiskIOAPIHandler - handleRequest");
        try {
            FileLogger.writeFile(messageContext.getMessageID() +
                    " : " + "" + "\n");
        } catch (Exception e) {
            logger.error(e.getMessage(), e);
            return false;
        }

        return true;
    }

    public boolean handleResponse(MessageContext messageContext) {
        logger.error("Inside DiskIOAPIHandler - handleResponse");
        try {
            FileLogger.writeFile(messageContext.getMessageID() +
                    " : " + "" + "\n");
        } catch (Exception e) {
            logger.error(e.getMessage(), e);
            return false;
        }

        return true;
    }

    @Override
    public void init(SynapseEnvironment se) {
        logger.error("Inside DiskIOAPIHandler - init");
        try {
            FileLogger.createFile("Handler Initialization");
        } catch (Exception e) {
            logger.error(e.getMessage(), e);
        }
    }

    @Override
    public void destroy() {
        logger.error("Inside DiskIOAPIHandler - destroy");
        try {
            FileLogger.writeFile("Handler Destruction");
        } catch (Exception e) {
            logger.error(e.getMessage(), e);
        }
    }
}
